var title_f16_29_16851="Loop of Henle anatomy";
var content_f16_29_16851=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F76121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F76121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 481px\">",
"   <div class=\"ttl\">",
"    Anatomic relations of the different nephron segments",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 461px; height: 326px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The anatomic relationships between the different nephron segments, according to the location of the glomeruli in the outer cortex (OC), midcortex (MC), or juxtamedullary area (JM).",
"    <div class=\"footnotes\">",
"     The major nephron segments are labelled as follows: PCT: proximal convoluted tubule; PR: pars recta, which ends in the S3 segment at the junction of the outer and inner stripes of the outer medulla; DLH: descending limb of the loop of Henle; tAL: thin ascending limb, which is not present in outer cortical nephrons that have short loops of Henle; TAL: thick ascending limb, which ends in the macula densa adjacent to the parent glomerulus; DCT: distal convoluted tubule; CS: connecting segment; CCT: cortical collecting tubule; MCT: medullary collecting tubule; and PCD: papillary collecting duct at the end of the medullary collecting tubule.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Jacobson, HR, Am J Physiol 1981; 241:F203.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
