var title_f16_29_16860="Food intolerances IBD";
var content_f16_29_16860=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F73175&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F73175&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Foods and beverages that may worsen gastrointestinal symptoms",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Milk, milk-containing products, and lactose-free milk products, including ice cream, cream cheese, cheese, cottage cheese, yogurt, pudding, whipped cream, cream, cheesecake, chocolate, pastries, crackers, pretzels, cookies, crackers, cakes, and pies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Caffeine-containing products, including coffee, tea, and sodas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alcohol products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fruits and fruit juices",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Spices, seasonings, and spicy marinades",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diet beverages, diet foods, diet candies, diet gum, sugar-free products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fried foods, fatty foods, fast foods, and Chinese food",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Condiments including ketchup, mustard, mayonnaise, and relish",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Wholegrain or multigrain breads; sourdough breads, bagels, and yeast-containing products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Salads, particularly added components including bacon bits, croutons, onions, and peppers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Salad dressings that contain mayonnaise, cheese, and spices",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vegetables including cabbage, broccoli, and cauliflower",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Legumes: beans, lentils, chili",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Red meats including steak, hamburger, sausage, bacon, and prime rib",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gravies, spaghetti sauce, soups, stews, and stuffing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Popcorn, peanuts, corn",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Artificial colorings, flavorings, and sweeteners",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Foods and beverages containing sorbitol, fructose, or high fructose corn syrup",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The foods and drinks listed above may worsen gastrointestinal symptoms (diarrhea, cramps, abdominal pain, nausea, gas, bloating, heartburn, etc) in some patients with both irritable bowel syndrome and inflammatory bowel disease. These symptoms can begin as soon as 5 to 15 minutes after eating or as many as 12 to 48 hours later.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: MacDermott RP. Treatment of irritable bowel syndrome in outpatients with inflammatory bowel disease using a food and beverage intolerance, food and beverage avoidance diet. Inflamm Bowel Dis 2007; 13:91.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
